import classes from './TourPackage.css';
import Link from '../../../hoc/UI/LinkTag/Link';

class tourPackage extends Component {
	shouldComponentUpdate(nextProps, nextState) {
		if (nextProps !== this.props) {
			console.log('shouldComponentUpdate Tourpkg.js -', nextProps,this.props);
			return true;
		}
		return false;
	}
	render() {
		return (

			<div className={classes.TourPackage} onClick={this.props.clicked}>
				<p> {this.props.tourPkge.title}</p>
				<Link link='/'>More about..</Link>
			</div>
		);
	}
}

export default tourPackage;
